import ExpenseItem from "./ExpenseItem";

import classes from "./ExpenseList.module.css";

const ExpenseList = (props) => {
  let content = <p>No data found, try adding some.</p>;
  if (props.expenses.length > 0) {
    content = props.expenses.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        date={expense.date}
        amount={expense.amount}
      />
    ));
  }

  return <div className={classes["expenses-list"]}>{content}</div>;
};

export default ExpenseList;
